import React, { useState } from 'react';
import Homepage from './pages/Homepage';
import CreateProjectPage from './pages/CreateProject';

function App() {
    const [currentPage, setCurrentPage] = useState('home');

    return (
        <div className="App">
            {currentPage === 'home' ? (
                <Homepage onNavigate={() => setCurrentPage('create-project')} />
            ) : (
                <CreateProjectPage onBack={() => setCurrentPage('home')} />
            )}
        </div>
    );
}

export default App;
